import React from "react";
import Counters from "../Counters.js";
import gamepadImage from "../images/gamepad.png";
import NavigationButton from "../NavigationButton.js";

import "../styles/MainPageClicker.css";

export function MainPage(){
    return (
        <div className="MainPage">
            <Counters isDisabledDataCounters={false} />
            <div className="MainPageClicker">
                <div className="MainPageLeftMenu">

                </div>
                <div className="MainPageClickerBox">
                    <button className="MainPageClickerButton">
                        <img src={gamepadImage} className="MainPageClickerImage" />
                    </button>
                </div>
                <div className="MainPageRightMenu">

                </div>
            </div>
        </div>
    );
};
